import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Drawer, List, ListItem, ListItemIcon, ListItemText } from '@material-ui/core';
import { Home as HomeIcon, People as PeopleIcon, Info as InfoIcon } from '@material-ui/icons';
import './App.css'; // Import the CSS file for styling
import logo from './assets/logo.png'; // Import the logo image

const HomePage = () => {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  const toggleSidebar = () => {
    setIsSidebarOpen(!isSidebarOpen);
  };

  return (
    <Router>
      <div className="homepage">
        <header>
        <img src={logo} alt="Logo" className="logo" /> {/* Use the imported logo */}
          <h1 className="title">Welcome to Arthmate</h1>
        </header>
        <nav className="tabs">
          <Link to="/" className="tab-link" activeClassName="active">
            <HomeIcon className="tab-icon" />
            Introduction
          </Link>
          <Link to="/team" className="tab-link" activeClassName="active">
            <PeopleIcon className="tab-icon" />
            Team
          </Link>
          <Link to="/about" className="tab-link" activeClassName="active">
            <InfoIcon className="tab-icon" />
            What We Do
          </Link>
        </nav>
        <div className="content">
          <Routes>
            <Route path="/" element={<Introduction />} />
            <Route path="/team" element={<Team />} />
            <Route path="/about" element={<About />} />
          </Routes>
        </div>
        <Drawer anchor="left" open={isSidebarOpen} onClose={toggleSidebar}>
          <List>
            <ListItem button component={Link} to="/" onClick={toggleSidebar}>
              <ListItemIcon>
                <HomeIcon />
              </ListItemIcon>
              <ListItemText primary="Introduction" />
            </ListItem>
            <ListItem button component={Link} to="/team" onClick={toggleSidebar}>
              <ListItemIcon>
                <PeopleIcon />
              </ListItemIcon>
              <ListItemText primary="Team" />
            </ListItem>
            <ListItem button component={Link} to="/about" onClick={toggleSidebar}>
              <ListItemIcon>
                <InfoIcon />
              </ListItemIcon>
              <ListItemText primary="What We Do" />
            </ListItem>
          </List>
        </Drawer>
        <button className="toggle-sidebar-btn" onClick={toggleSidebar}>
          Toggle Sidebar
        </button>
      </div>
    </Router>
  );
};

const Introduction = () => {
  return (
    <div>
      <h2>Introduction</h2>
      <p>
        Insert your introductory content here from the official website of Arthmate.
      </p>
    </div>
  );
};

const Team = () => {
  return (
    <div>
      <h2>Team</h2>
      <p>
        Insert information about your team members here from the official website of Arthmate.
      </p>
    </div>
  );
};

const About = () => {
  return (
    <div>
      <h2>What We Do</h2>
      <p>
        Insert information about what your company does here from the official website of Arthmate.
      </p>
    </div>
  );
};

export default HomePage;
